<script>
var shaders = {};
shaders["points-vs"] = "in vec3 aVertexPosition;\nin vec4 aVertexColour;\nin vec2 aVertexTexCoord;\n\nuniform mat4 uMVMatrix;\nuniform mat4 uPMatrix;\n\nout vec4 vColour;\n\n#ifdef WEBGL\nconst int uPointDist = 1;   // Scale by distance\n#else\nuniform int uPointDist;   // Scale by distance\n#endif\n\nin float aSize;\nin float aPointType;\n\nuniform float uPointScale;   // scale to calculate size in pixels\n\nuniform vec4 uColour;\nuniform float uOpacity;\n\nout vec3 vVertex;\nout vec2 vTexCoord;\nout float vPointSize;\nout vec3 vPosEye;\nout float vPointType;\n\nvoid main(void)\n{\n  float pSize = abs(aSize);\n\n  // calculate window-space point size\n  vec4 mvPosition = uMVMatrix * vec4(aVertexPosition, 1.0);\n  vec3 posEye = mvPosition.xyz;\n  float dist = 1.0;\n  if (uPointDist > 0)\n     dist = length(posEye);\n  //Limit scaling, overly large points are very slow to render\n  //gl_PointSize = max(1.0, min(40.0, uPointScale * pSize / dist));\n\n  gl_PointSize = uPointScale * pSize / dist;\n  gl_Position = uPMatrix * mvPosition;\n\n  vPosEye = posEye;\n  vPointType = aPointType;\n  vPointSize = gl_PointSize;\n  vVertex = aVertexPosition.xyz;\n  vTexCoord = aVertexTexCoord;\n\n  if (uColour.a > 0.0)\n    vColour = uColour;\n  else\n    vColour = vec4(aVertexColour.rgb, aVertexColour.a);\n}\n\n";shaders["points-fs"] = "uniform int uPointType;\nuniform float uOpacity;\nuniform float uBrightness;\nuniform float uContrast;\nuniform float uSaturation;\nuniform float uAmbient;\nuniform float uDiffuse;\nuniform float uSpecular;\nuniform bool uOpaque;\nuniform bool uTextured;\nuniform sampler2D uTexture;\nuniform vec3 uClipMin;\nuniform vec3 uClipMax;\nuniform vec3 uLightPos;\n\nin vec4 vColour;\nin vec3 vVertex;\nin vec2 vTexCoord;\nin float vPointSize;\nin vec3 vPosEye;\nin float vPointType;\n\n#ifdef WEBGL\n#define outColour gl_FragColor\n#define texture(a,b) texture2D(a,b)\n#else\nout vec4 outColour;\n#endif\n\nvoid calcColour(vec3 colour, float alpha)\n{\n  //Brightness adjust\n  colour += uBrightness;\n  //Saturation & Contrast adjust\n  const vec3 LumCoeff = vec3(0.2125, 0.7154, 0.0721);\n  vec3 AvgLumin = vec3(0.5, 0.5, 0.5);\n  vec3 intensity = vec3(dot(colour, LumCoeff));\n  colour = mix(intensity, colour, uSaturation);\n  colour = mix(AvgLumin, colour, uContrast);\n\n  if (uOpaque)\n    alpha = 1.0;\n\n  outColour = vec4(colour, alpha);\n}\n\nvoid main(void)\n{\n  //Clip planes in X/Y/Z\n  if (any(lessThan(vVertex, uClipMin)) || any(greaterThan(vVertex, uClipMax))) discard;\n\n  float alpha = vColour.a;\n  if (uOpacity > 0.0) alpha *= uOpacity;\n  outColour = vColour;\n\n  int pointType = uPointType;\n  if (vPointType >= 0.0) pointType = int(floor(vPointType + 0.5)); //Round back to nearest int\n\n  //Textured?\n  if (uTextured && vTexCoord.y >= 0.0)\n  {\n    vec4 tColour;\n    if (vTexCoord.x < 0.0)\n      tColour = texture(uTexture, gl_PointCoord); //Point sprite mode\n    else\n      tColour = texture(uTexture, vTexCoord);\n\n    //Blend with colour\n    outColour = mix(tColour, outColour, 1.0-tColour.a);\n    alpha = outColour.a;\n  }\n\n  //Flat, square points, fastest, skip lighting\n  if (pointType == 4)\n  {\n    calcColour(outColour.rgb, alpha);\n    return;\n  }\n\n  //Circular points...\n  //Calculate normal from point/tex coordinates\n  vec3 N;\n  N.xy = gl_PointCoord * 2.0 - vec2(1.0);\n  float R = dot(N.xy, N.xy);\n  //Discard if outside circle\n  if (R > 1.0) discard;\n  //Anti-aliased edges for sphere types\n  if (pointType > 1)\n  {\n    float edge = vPointSize - R * vPointSize;\n    if (edge <= 4.0)\n      alpha *= (0.25 * edge);\n  }\n\n  //Discard if transparent (outside circle)\n  if (alpha < 0.01) discard;\n\n  if (pointType < 2)\n  {\n    //Circular with no light/shading, just blur\n    if (pointType == 0)\n      alpha *= 1.0-sqrt(R); //Gaussian\n    else //TODO: allow disable blur for circular points\n      alpha *= 1.0-R;       //Linear\n\n    calcColour(outColour.rgb, alpha);\n    return;\n  }\n\n  //Calculate diffuse lighting component\n  N.z = sqrt(1.0-R);\n  float diffuse = 1.0;\n  vec3 lightDir = normalize(uLightPos - vPosEye);\n  diffuse = max(0.0, dot(lightDir, N));\n\n  //Calculate specular lighting component\n  if (pointType == 3 && diffuse > 0.0)\n  {\n    vec3 specular = vec3(0.0,0.0,0.0);\n    float shininess = 200.0; //Size of highlight\n    vec3 specolour = vec3(1.0, 1.0, 1.0);   //Color of light\n    //Normalize the half-vector\n    //vec3 halfVector = normalize(vPosEye + lightDir);\n    vec3 halfVector = normalize(vec3(0.0, 0.0, 1.0) + lightDir);\n    //Compute cosine (dot product) with the normal\n    float NdotHV = max(dot(N, halfVector), 0.0);\n    specular = specolour * pow(NdotHV, shininess);\n    calcColour(outColour.rgb * diffuse + specular, alpha);\n  }\n  else\n    calcColour(outColour.rgb * diffuse, alpha);\n}\n";shaders["lines-vs"] = "in vec3 aVertexPosition;\nin vec4 aVertexColour;\nuniform mat4 uMVMatrix;\nuniform mat4 uPMatrix;\n\n#ifndef WEBGL\nuniform int uPointDist;   // Scale by distance\n#endif\n\nuniform vec4 uColour;\nuniform float uOpacity;\n\nout vec4 vColour;\nout vec3 vVertex;\n\nvoid main(void)\n{\n  vec4 mvPosition = uMVMatrix * vec4(aVertexPosition, 1.0);\n  gl_Position = uPMatrix * mvPosition;\n\n  if (uColour.a > 0.0)\n    vColour = uColour;\n  else\n    vColour = vec4(aVertexColour.rgb, aVertexColour.a*uOpacity);\n\n  vVertex = aVertexPosition.xyz;\n}\n\n";shaders["lines-fs"] = "in vec4 vColour;\nin vec3 vVertex;\n\nuniform float uOpacity;\nuniform float uBrightness;\nuniform float uContrast;\nuniform float uSaturation;\nuniform vec3 uClipMin;\nuniform vec3 uClipMax;\nuniform bool uOpaque;\n\n#ifdef WEBGL\n#define outColour gl_FragColor\n#else\nout vec4 outColour;\n#endif\n\nvoid main(void)\n{\n  //Clip planes in X/Y/Z\n  if (any(lessThan(vVertex, uClipMin)) || any(greaterThan(vVertex, uClipMax))) discard;\n\n  vec4 colour = vColour;\n  float alpha = colour.a;\n  if (uOpacity > 0.0) alpha *= uOpacity;\n\n  //Brightness adjust\n  colour += uBrightness;\n  //Saturation & Contrast adjust\n  const vec4 LumCoeff = vec4(0.2125, 0.7154, 0.0721, 0.0);\n  vec4 AvgLumin = vec4(0.5, 0.5, 0.5, 0.0);\n  vec4 intensity = vec4(dot(colour, LumCoeff));\n  colour = mix(intensity, colour, uSaturation);\n  colour = mix(AvgLumin, colour, uContrast);\n  colour.a = alpha;\n\n  if (alpha < 0.01) discard;\n\n  if (uOpaque)\n    colour.a = 1.0;\n\n  outColour = colour;\n}\n";shaders["triangles-vs"] = "in vec3 aVertexPosition;\nin vec3 aVertexNormal;\nin vec4 aVertexColour;\nin vec2 aVertexTexCoord;\n#ifndef WEBGL\nflat out vec4 vFlatColour;\n#endif\n\nuniform mat4 uMVMatrix;\nuniform mat4 uPMatrix;\nuniform mat4 uNMatrix;\n\nuniform vec4 uColour;\nuniform vec4 uLightPos;\n\nout vec4 vColour;\nout vec3 vNormal;\nout vec3 vPosEye;\nout vec2 vTexCoord;\nout vec3 vVertex;\nout vec3 vLightPos;\n\nvoid main(void)\n{\n  vec4 mvPosition = uMVMatrix * vec4(aVertexPosition, 1.0);\n  vPosEye = vec3(mvPosition) / mvPosition.w;\n  gl_Position = uPMatrix * mvPosition;\n\n  vNormal = normalize(mat3(uNMatrix) * aVertexNormal);\n\n  if (uColour.a > 0.0)\n    vColour = uColour;\n  else\n    vColour = aVertexColour;\n\n  vTexCoord = aVertexTexCoord;\n#ifndef WEBGL\n  vFlatColour = vColour;\n#endif\n  vVertex = aVertexPosition;\n\n  //Head light, lightPos=(0,0,0) - vPosEye\n  //vec3 lightDir = normalize(uLightPos.xyz - vPosEye);\n  if (uLightPos.w < 0.5)\n  {\n    //Light follows camera - default mode\n    vLightPos = uLightPos.xyz;\n  }\n  else\n  {\n    //Fixed Scene Light, when lightpos.w set to 1.0\n    vLightPos = (uMVMatrix * vec4(uLightPos.xyz, 1.0)).xyz;\n  }\n}\n\n";shaders["triangles-fs"] = "in vec4 vColour;\nin vec3 vNormal;\nin vec3 vPosEye;\nin vec3 vVertex;\nin vec2 vTexCoord;\nin vec3 vLightPos;\n\nuniform float uOpacity;\nuniform bool uLighting;\nuniform float uBrightness;\nuniform float uContrast;\nuniform float uSaturation;\nuniform float uAmbient;\nuniform float uDiffuse;\nuniform float uSpecular;\nuniform float uShininess;\n\nuniform bool uTextured;\nuniform sampler2D uTexture;\nuniform vec3 uClipMin;\nuniform vec3 uClipMax;\nuniform bool uOpaque;\nuniform vec4 uLight;\n\n#ifdef WEBGL\n#define outColour gl_FragColor\n#define texture(a,b) texture2D(a,b)\n\n//Before OpenGL 3+ we need our own isnan function\nbool isnan3(vec3 val)\n{\n  if (!(val.x < 0.0 || 0.0 < val.x || val.x == 0.0)) return true;\n  if (!(val.y < 0.0 || 0.0 < val.y || val.y == 0.0)) return true;\n  if (!(val.z < 0.0 || 0.0 < val.z || val.z == 0.0)) return true;\n  return false;\n}\n\n#else\n#define isnan3(v) any(isnan(v))\nflat in vec4 vFlatColour;\nuniform bool uFlat;\nout vec4 outColour;\n#endif\n\nuniform bool uCalcNormal;\n\nvoid calcColour(vec3 colour, float alpha)\n{\n  //Brightness adjust\n  colour += uBrightness;\n  //Saturation & Contrast adjust\n  const vec3 LumCoeff = vec3(0.2125, 0.7154, 0.0721);\n  vec3 AvgLumin = vec3(0.5, 0.5, 0.5);\n  vec3 intensity = vec3(dot(colour, LumCoeff));\n  colour = mix(intensity, colour, uSaturation);\n  colour = mix(AvgLumin, colour, uContrast);\n\n  //Gamma correction\n  //https://en.wikipedia.org/wiki/Blinn%E2%80%93Phong_reflection_model#OpenGL_Shading_Language_code_sample\n  //const float screenGamma = 2.2; // Assume the monitor is calibrated to the sRGB color space\n  //vec3 colorGammaCorrected = pow(color, vec3(1.0 / screenGamma));\n\n  outColour = vec4(colour, alpha);\n}\n\nvoid main(void)\n{\n  //Clip planes in X/Y/Z\n  if (any(lessThan(vVertex, uClipMin)) || any(greaterThan(vVertex, uClipMax))) discard;\n\n  vec4 fColour = vColour;\n#ifndef WEBGL\n  if (uFlat)\n    fColour = vFlatColour;\n#endif\n  float alpha = fColour.a;\n  if (uTextured && vTexCoord.x > -1.0) //Null texcoord (-1,-1)\n  {\n    //With this blending mode, texture is blended over base colour,\n    //and colour opacity has no effect on texture opacity\n    //All desired texture opacity must be built in to the texture data\n    //(Could add another blend mode if we want a dynamic texture opacity)\n    vec4 tColour = texture(uTexture, vTexCoord);\n    if (fColour.a > 0.01)\n    {\n      //Additive blend alpha channel\n      alpha = fColour.a + tColour.a * (1.0 - fColour.a);\n\n      //Blend the texure colour with the fragment colour using texture alpha\n      fColour.rgb = vec3(mix(fColour.rgb, tColour.rgb, tColour.a));\n    }\n    else\n    {\n      //Disable all blending if the base colour opacity <= 0.01\n      fColour = tColour;\n      alpha = tColour.a;\n    }\n  }\n\n  if (uOpacity > 0.0) alpha *= uOpacity;\n  if (uOpaque) alpha = 1.0;\n  if (alpha < 0.01) discard;\n\n  if (!uLighting) \n  {\n    calcColour(fColour.rgb, alpha);\n    return;\n  }\n\n  vec3 lightColour = uLight.xyz;\n  \n  //Light direction\n  vec3 lightDir = normalize(vLightPos - vPosEye);\n\n  //Calculate diffuse lighting\n  vec3 N = normalize(vNormal);\n\n  //Default normal...\n  if (uCalcNormal || dot(N,N) < 0.01 || isnan3(N))\n  {\n    //Requires extension in WebGL: OES_standard_derivatives\n    vec3 fdx = vec3(dFdx(vPosEye.x),dFdx(vPosEye.y),dFdx(vPosEye.z));    \n    vec3 fdy = vec3(dFdy(vPosEye.x),dFdy(vPosEye.y),dFdy(vPosEye.z));\n    N = normalize(cross(fdx,fdy)); \n  }\n\n  //Modified to use energy conservation adjustment\n  //https://learnopengl.com/Advanced-Lighting/Advanced-Lighting\n  const float kPi8 = 3.14159265 * 8.0;\n\n  //Calculate diffuse component\n  //Single side or two-sided lighting with abs()?\n  float diffuse = dot(N, lightDir);\n  if (uLight.w < 0.5)\n    diffuse = abs(diffuse);\n  else\n    diffuse = max(diffuse, 0.0);\n\n  //Compute the specular term\n  if (diffuse > 0.0 && uSpecular > 0.0)\n  {\n    //Specular power, higher is more focused/shiny\n    float shininess = 256.0 * clamp(uShininess, 0.0, 1.0);\n    vec3 specolour = lightColour; //Color of light - use the same as diffuse/ambient\n    //Blinn-Phong\n    vec3 viewDir = normalize(-vPosEye);\n    //Normalize the half-vector\n    vec3 halfVector = normalize(lightDir + viewDir);\n\n    //Compute cosine (dot product) with the normal\n    float NdotHV = dot(N, halfVector);\n    //Single side or two-sided lighting with abs()?\n    if (uLight.w < 0.5)\n      NdotHV = abs(NdotHV);\n    else\n      NdotHV = max(NdotHV, 0.0);\n\n    //Energy conservation adjustment (more focused/shiny highlight will be brighter)\n    float energyConservation = ( 8.0 + shininess) / kPi8;\n    //Multiplying specular by diffuse prevents bands at edges for low shininess\n    float spec = diffuse * uSpecular * energyConservation * pow(NdotHV, shininess);\n\n    //Final colour - specular + diffuse + ambient\n    calcColour(lightColour * (fColour.rgb * (uAmbient + uDiffuse * diffuse) + vec3(spec)), alpha);\n  }\n  else\n    //Final colour - diffuse + ambient only\n    calcColour(lightColour * fColour.rgb * (uAmbient + diffuse * uDiffuse), alpha);\n}\n\n";shaders["volume-vs"] = "in vec4 aVertexPosition;\nvoid main(void)\n{\n  gl_Position = aVertexPosition;\n}\n";shaders["volume-fs"] = "/*\n * Copyright (c) 2014, Monash University. All rights reserved.\n * Author: Owen Kaluza - owen.kaluza ( at ) monash.edu\n *\n * Licensed under the GNU Lesser General Public License\n * https://www.gnu.org/licenses/lgpl.html\n * (volume shader from sharevol https://github.com/OKaluza/sharevol)\n */\n#ifdef WEBGL\nuniform sampler2D uVolume;\n#define NO_DEPTH_WRITE\n#define outColour gl_FragColor\n#define texture(a,b) texture2D(a,b)\n#else\n//Included dynamically before compile in WebGL mode...\nconst int maxSamples = 2048;\nuniform sampler3D uVolume;\nout vec4 outColour;\n#endif\n\nconst float depthT = 0.99; //Transmissivity threshold below which depth write applied\n\nuniform sampler2D uTransferFunction;\n\nuniform vec3 uBBMin;\nuniform vec3 uBBMax;\nuniform vec3 uResolution;\n\nuniform bool uEnableColour;\n\nuniform float uBrightness;\nuniform float uContrast;\nuniform float uSaturation;\nuniform float uPower;\nuniform float uBloom;\n\nuniform mat4 uMVMatrix;\nuniform mat4 uTMVMatrix;\nuniform mat4 uMVPMatrix;\nuniform mat4 uInvMVPMatrix;\nuniform mat4 uNMatrix;\nuniform vec4 uViewport;\nuniform int uSamples;\nuniform float uDensityFactor;\nuniform float uIsoValue;\nuniform vec4 uIsoColour;\nuniform float uIsoSmooth;\nuniform int uIsoWalls;\nuniform int uFilter;\nuniform vec2 uRange;\nuniform vec2 uDenMinMax;\n\nuniform float uAmbient;\nuniform float uDiffuse;\nuniform float uSpecular;\nuniform vec3 uLightPos;\nuniform bool uLighting;\n\nvec3 bbMin;\nvec3 bbMax;\n\n#ifdef ENABLE_TRICUBIC\nfloat interpolate_tricubic_fast(vec3 coord);\n#endif\n\n#ifdef WEBGL\n\nvec2 islices = vec2(1.0 / slices.x, 1.0 / slices.y);\nfloat maxslice = slices.x * slices.y - 1.0;\n//Clamp to a bit before halfway for the edge voxels\nvec2 cmin = vec2(0.55/(slices.x*slices.y), 0.55/(slices.x*slices.y));\nvec2 cmax = vec2(1.0, 1.0) - cmin;\n\nfloat sample(vec3 pos)\n{\n  //Get z slice index and position between two slices\n  float Z = pos.z * maxslice;\n  float slice = floor(Z); //Index of first slice\n  Z = fract(Z);\n  //Edge case at z min (possible with tricubic filtering)\n  if (int(slice) < 0)\n  {\n    slice = 0.0;\n    Z = 0.0;\n  }\n  //Edge case at z max\n  else if (int(slice) > int(maxslice)-1)\n  {\n    slice = maxslice-1.0;\n    Z = 1.0;\n  }\n  //Only start interpolation with next Z slice 1/3 from edges at first & last z slice\n  //(this approximates how 3d texture volume is sampled at edges with linear filtering\n  // due to edge sample being included in weighted average twice)\n  // - min z slice\n  else if (int(slice) == 0)\n  {\n    Z = max(0.0, (Z-0.33) * 1.5);\n  }\n  // - max z slice\n  else if (int(slice) == int(maxslice)-1)\n  {\n    Z = min(1.0, Z*1.5);\n  }\n\n  //X & Y coords of sample scaled to slice size\n  //(Clamp range at borders to prevent bleeding between tiles due to linear filtering)\n  vec2 sampleOffset = clamp(pos.xy, cmin, cmax) * islices;\n  //Offsets in 2D texture of given slice indices\n  //(add offsets to scaled position within slice to get sample positions)\n  float A = slice * islices.x;\n  float B = (slice+1.0) * islices.x;\n  vec2 z1offset = vec2(fract(A), floor(A) / slices.y) + sampleOffset;\n  vec2 z2offset = vec2(fract(B), floor(B) / slices.y) + sampleOffset;\n\n  //Interpolate the final value by position between slices [0,1]\n  return mix(texture2D(uVolume, z1offset).x, texture2D(uVolume, z2offset).x, Z);\n}\n\n#else\n#define sample(pos) (texture(uVolume, pos).x)\n#endif\n\nfloat tex3D(vec3 pos)\n{\n  float density;\n//TODO: this can't be enabled outside WebGL currently\n#ifdef ENABLE_TRICUBIC\n  if (uFilter > 0)\n    density = interpolate_tricubic_fast(pos);\n  else\n#endif\n    density = sample(pos);\n\n  //Normalise the density over provided range\n  //(used for float textures only, all other formats are already [0,1])\n  density = (density - uRange.x) / (uRange.y - uRange.x);\n  //density = (density - uRange.x) * irange;\n  return density;\n}\n\nvoid lighting(in vec3 pos, in vec3 normal, inout vec3 colour)\n{\n  vec4 vertPos = uMVMatrix * vec4(pos, 1.0);\n  //Light moves with camera at specified offset\n  vec3 lightDir = normalize(uLightPos - vertPos.xyz);\n  float diffuse = clamp(abs(dot(normal, lightDir)), 0.1, 1.0);\n  vec3 lightWeighting = vec3(uAmbient + diffuse * uDiffuse);\n  colour *= lightWeighting;\n}\n\nvec3 isoNormal(in vec3 pos, in vec3 shift)\n{\n  //Detect bounding box hit (walls)\n  if (uIsoWalls > 0)\n  {\n    if (pos.x <= bbMin.x) return vec3(-1.0, 0.0, 0.0);\n    if (pos.x >= bbMax.x) return vec3(1.0, 0.0, 0.0);\n    if (pos.y <= bbMin.y) return vec3(0.0, -1.0, 0.0);\n    if (pos.y >= bbMax.y) return vec3(0.0, 1.0, 0.0);\n    if (pos.z <= bbMin.z) return vec3(0.0, 0.0, -1.0);\n    if (pos.z >= bbMax.z) return vec3(0.0, 0.0, 1.0);\n  }\n\n  //Calculate normal\n  //by central difference gradient \n  //(slower, faster way would be to precompute a gradient texture)\n  vec3 pos1 = vec3(tex3D(vec3(pos.x+shift.x, pos.y, pos.z)), \n                   tex3D(vec3(pos.x, pos.y+shift.y, pos.z)), \n                   tex3D(vec3(pos.x, pos.y, pos.z+shift.z)));\n  vec3 pos2 = vec3(tex3D(vec3(pos.x-shift.x, pos.y, pos.z)), \n                   tex3D(vec3(pos.x, pos.y-shift.y, pos.z)), \n                   tex3D(vec3(pos.x, pos.y, pos.z-shift.z)));\n  return normalize(pos1 - pos2);\n}\n\nvec2 rayIntersectBox(vec3 rayDirection, vec3 rayOrigin)\n{\n  //Intersect ray with bounding box\n  vec3 rayInvDirection = 1.0 / rayDirection;\n  vec3 bbMinDiff = (bbMin - rayOrigin) * rayInvDirection;\n  vec3 bbMaxDiff = (bbMax - rayOrigin) * rayInvDirection;\n  vec3 imax = max(bbMaxDiff, bbMinDiff);\n  vec3 imin = min(bbMaxDiff, bbMinDiff);\n  float back = min(imax.x, min(imax.y, imax.z));\n  float front = max(max(imin.x, 0.0), max(imin.y, imin.z));\n  return vec2(back, front);\n}\n\nvoid main()\n{\n    if (any(greaterThan(uBBMin, uBBMax)))\n    {\n      bbMin = vec3(0.0);\n      bbMax = vec3(1.0);\n    }\n    else\n    {\n      bbMin = clamp(uBBMin, vec3(0.0), vec3(1.0));\n      bbMax = clamp(uBBMax, vec3(0.0), vec3(1.0));\n    }\n\n    //Compute eye space coord from window space to get the ray direction\n    //ObjectSpace *[MV] = EyeSpace *[P] = Clip /w = Normalised device coords ->VP-> Window\n    //Window ->[VP^]-> NDC ->[/w]-> Clip ->[P^]-> EyeSpace ->[MV^]-> ObjectSpace\n    vec4 ndcPos;\n    ndcPos.xy = ((2.0 * gl_FragCoord.xy) - (2.0 * uViewport.xy)) / (uViewport.zw) - 1.0;\n    //ndcPos.z = (2.0 * gl_FragCoord.z - gl_DepthRange.near - gl_DepthRange.far) /\n    //           (gl_DepthRange.far - gl_DepthRange.near);\n    ndcPos.z = 2.0 * gl_FragCoord.z - 1.0;\n    ndcPos.w = 1.0;\n    vec4 clipPos = ndcPos / gl_FragCoord.w;\n    //vec4 eyeSpacePos = uInvPMatrix * clipPos;\n    vec3 rayDirection = normalize((uInvMVPMatrix * clipPos).xyz);\n\n    //Ray origin from the camera position\n    vec4 camPos = -vec4(uMVMatrix[3]);  //4th column of modelview\n    vec3 rayOrigin = (uTMVMatrix * camPos).xyz;\n\n    //Calc step\n    float stepSize = 1.732 / float(uSampl //WebGL viewer, Owen Kaluza (c) Monash University 2012-18

var server = false;
var types = ["triangles", "points", "lines", "volume"]
var MAXIDX = 2047;
/** @const */
var DEBUG = false;

function initPage(elid, menu, src) {
  //Load from the data tag if available, otherwise URL
  var dtag = document.getElementById('data');
  if (!src && dtag && dtag.innerHTML.length > 100)
    src = dtag.innerHTML;

  var urlq = decodeURI(window.location.href);
  if (!src && urlq.indexOf("?") > 0) {
    var parts = urlq.split("?"); //whole querystring before and after ?
    var query = parts[1]; 

    if (query.indexOf(".json") > 0) {
      //Passed a json(p) file on URL
      if (query.indexOf(".jsonp") > 0) {
        //Load jsonp file as a script, useful when opening page as file://
        //only way to get around security issues in chrome, 
        //script calls the loadData function providing the content
        var script = document.createElement('script');
        script.id = 'script';
        script.style.display = 'none';
        script.src = query;
        document.body.appendChild(script);
      } else {
        var el = document.getElementById('fileupload');
        if (el) el.style.display = "none";
        progress("Downloading model data from server...");
        ajaxReadFile(query, initPage, false, updateProgress);
      }
      return;
    }
  } else if (!src && urlq.indexOf("#") > 0) {
    //IPython strips out ? args so have to check for this instead
    var parts = urlq.split("#"); //whole querystring before and after #
    if (parts[1].indexOf(".json") > 0) {
      //Load filename from url
      ajaxReadFile(parts[1], initPage, false);
      return;
    }

    //Load base64 encoded data from url
    window.location.hash = ""
    src = window.atob(parts[1]);
  }

  progress();

  var container;
  if (elid)
    container = document.getElementById(elid);
  else
    container = document.body;
  var canvas = document.createElement("canvas");
  canvas.id = "canvas_" + container.id;
  container.appendChild(canvas);
  var viewer =  new Viewer(canvas);
  viewer.menu = menu; //GUI menu flag
  if (canvas) {
    //this.canvas = document.createElement("canvas");
    //this.canvas.style.cssText = "width: 100%; height: 100%; z-index: 0; margin: 0px; padding: 0px; background: black; border: none; display:block;";
    //if (!parentEl) parentEl = document.body;
    //parentEl.appendChild(this.canvas);

    //Canvas event handling
    var handler = new MouseEventHandler(canvasMouseClick, canvasMouseWheel, canvasMouseMove, canvasMouseDown, null, null, canvasMousePinch);
    canvas.mouse = new Mouse(canvas, handler);
    //Following two settings should probably be defaults?
    canvas.mouse.moveUpdate = true; //Continual update of deltaX/Y
    //canvas.mouse.setDefault();

    canvas.mouse.wheelTimer = true; //Accumulate wheel scroll (prevents too many events backing up)
    defaultMouse = document.mouse = canvas.mouse;

    //Reference to viewer object on canvas for event handling
    canvas.viewer = viewer;
    window.viewer = viewer; //Only most recent stored on window

    //Enable auto resize for full screen view
    if (canvas.parentElement == document.body) {
      window.onresize = function() {viewer.drawTimed();};
      //No border
      canvas.style.cssText = "width: 100%; height: 100%; z-index: 0; margin: 0px; padding: 0px; background: black; border: none; display:block;";
    } else {
      //Light border
      canvas.style.cssText = "width: 100%; height: 100%; z-index: 0; margin: 0px; padding: 0px; background: black; border: 1px solid #aaa; display:block;";
    }
  }

  //Data dict and colourmap names stored in globals
  viewer.dict = window.dictionary;
  viewer.defaultcolourmaps = window.defaultcolourmaps;

  if (query && query.indexOf("server") >= 0) {
    //Switch to image frame
    setAll('', 'server');
    setAll('none', 'client');

    server = true;

    //if (!viewer.gl) {
      //img = document.getElementById('frame');
      //Image canvas event handling
      //img.mouse = new Mouse(img, new MouseEventHandler(serverMouseClick, serverMouseWheel, serverMouseMove, serverMouseDown));
    //}

    //Initiate the server update
    requestData('/connect', parseRequest);
    //requestData('/objects', parseObjects);

    //Enable to forward key presses to server directly
    //document.onkeypress = keyPress;
    window.onbeforeunload = function() {if (client_id >= 0) requestData("/disconnect=" + client_id, null, true); client_id = -1;};

    //Set viewer window to match ours?
    //resizeToWindow();

  } else {
    setAll('none', 'server');
    setAll('', 'client');
    var frame = document.getElementById('frame');
    if (frame)
      frame.style.display = 'none';
  }

  if (src) {
    viewer.loadFile(src);
  } else {
    var source = getSourceFromElement('source');
    if (source) {
      //Preloaded data
      var el = document.getElementById('fileupload');
      if (el) el.style.display = "none";
      viewer.loadFile(source);
    } else {
      //Demo objects
      //demoData();
      viewer.draw();
    }
  }

  //VR setup
  if (navigator.getVRDisplays)
    setup_VR(viewer);
}

function loadData(data) {
  initPage(data);
}

function progress(text) {
  var el = document.getElementById('progress');
  if (!el) return;
  if (el.style.display == 'block' || text == undefined)
    //el.style.display = 'none';
    setTimeout("document.getElementById('progress').style.display = 'none';", 150);
  else {
    document.getElementById('progressmessage').innerHTML = text;
    document.getElementById('progressstatus').innerHTML = "";
    document.getElementById('progressbar').style.width = 0;
    el.style.display = 'block';
  }
}

function canvasMouseClick(event, mouse) {
  if (server) {
    if (mouse.element.viewer.rotating)
      sendCommand('' + mouse.element.viewer.getRotationString());
    else
      sendCommand('' + mouse.element.viewer.getTranslationString());
  }

  //if (server) serverMouseClick(event, mouse); //Pass to server handler
  if (mouse.element.viewer.rotating) {
    mouse.element.viewer.rotating = false;
    //mouse.element.viewer.reload = true;
    sortTimer(false, mouse.element.viewer);
    return false;
  }

  mouse.element.viewer.draw();
  return false;
}

function sortTimer(ifexists, viewer) {
  if (viewer.vis.sortenabled == false) {
    //Sorting disabled
    viewer.rotated = false;
    viewer.draw();
    return;
  }
  if (viewer.vis.immediatesort == true) {
    //No timers
    viewer.rotated = true; 
    viewer.draw();
    return;
  }
  //Set a timer to apply the sort function in 2 seconds
  if (viewer.timer) {
    clearTimeout(viewer.timer);
  } else if (ifexists) {
    //No existing timer? Don't start a new one
    return;
  }

  viewer.timer = setTimeout(function() {viewer.rotated = true; viewer.draw();}, 50);
}

function canvasMouseDown(event, mouse) {
  //if (server) serverMouseDown(event, mouse); //Pass to server handler
  return false;
}

var hideTimer;

function canvasMouseMove(event, mouse) {
  //if (server) serverMouseMove(event, mouse); //Pass to server handler

  //GUI elements to show on mouseover
  if (mouse.element && mouse.element.viewer) {
    var gui = mouse.element.viewer.gui;
    var rect = mouse.element.getBoundingClientRect();
    x = event.clientX-rect.left;
    y = event.clientY-rect.top;
    if (x >= 0 && y >= 0 && x < rect.width && y < rect.height) {
      if (!gui && mouse.element.imgtarget)
        mouse.element.imgtarget.nextElementSibling.style.display = "block";

      if (gui) {
        if (mouse.element.imgtarget) mouse.element.imgtarget.nextElementSibling.style.display = "none";
        gui.domElement.style.display = "block";
      }

      if (hideTimer)
        clearTimeout(hideTimer);

      hideTimer = setTimeout(function () { hideMenu(mouse.element, gui);}, 1000 );
    }
  }

  if (!mouse.isdown || !mouse.element.viewer) return true;
  mouse.element.viewer.rotating = false;

  //Switch buttons for translate/rotate
  var button = mouse.button;
  if (mouse.element.viewer.mode == "Translate") {
    //Swap rotate/translate buttons
    if (button == 0)
      button = 2
    else if (button == 2)
      button = 0;
  } else if (button==0 && mouse.element.viewer.mode == "Zoom") {
      button = 100;
  }

  //console.log(mouse.deltaX + "," + mouse.deltaY);
  switch (button)
  {
    case 0:
      mouse.element.viewer.rotateY(mouse.deltaX/5);
      mouse.element.viewer.rotateX(mouse.deltaY/5);
      mouse.element.viewer.rotating = true;
      sortTimer(true, mouse.element.viewer);  //Delay sort if queued
      break;
    case 1:
      mouse.element.viewer.rotateZ(Math.sqrt(mouse.deltaX*mouse.deltaX + mouse.deltaY*mouse.deltaY)/5);
      mouse.element.viewer.rotating = true;
      sortTimer(true, mouse.element.viewer);  //Delay sort if queued
      break;
    case 2:
      var adjust = mouse.element.viewer.modelsize / 1000;   //1/1000th of size
      mouse.element.viewer.translate[0] += mouse.deltaX * adjust;
      mouse.element.viewer.translate[1] -= mouse.deltaY * adjust;
      break;
    case 100:
      var adjust = mouse.element.viewer.modelsize / 1000;   //1/1000th of size
      mouse.element.viewer.translate[2] += mouse.deltaX * adjust;
      break;
  }

  //Always draw border while interacting in server mode?
  if (server)
    mouse.element.viewer.draw(true);
  //Draw border while interacting (automatically on for models > 500K vertices)
  //Hold shift to switch from default behaviour
  else if (mouse.element.viewer.vis.interactive)
    mouse.element.viewer.draw();
  else
    mouse.element.viewer.draw(!event.shiftKey);
  return false;
}
